import React from 'react';
import { UniversalLink } from '@plone/volto/components';
import './styles.less';

const LinkWrap = ({ item, pathname, children, isActive }) => {
  return item ? (
    <UniversalLink item={item}>
      <g className={isActive ? 'link-active' : ''}>
        <title>{item.title}</title>
        {children}
      </g>
    </UniversalLink>
  ) : (
    <g>{children}</g>
  );
};

